import React, { Component } from 'react';
import InputName from './InputName';
import Label from './Label';

class Formulario extends Component{

  render() {
    return (
      <form action="#" method="GET">
        <fieldset>
          <legend>Dados pessoais</legend>
          <Label ></Label>
          <InputName />
        </fieldset>
      </form>
    );
  };
}

export default Formulario;
